# https://leetcode.com/problems/number-of-submatrices-that-sum-to-target/

import collections
import itertools
from pprint import pprint
from typing import List


class Solution:

    def numSubmatrixSumTarget(self, matrix: List[List[int]], target: int) -> int:
        m, n = len(matrix), len(matrix[0])
        for row in matrix:
            for i in range(n - 1):
                row[i + 1] += row[i]

        res = 0
        for i in range(n):
            for j in range(i, n):
                c = collections.defaultdict(int)
                cur, c[0] = 0, 1
                for k in range(m):
                    cur += matrix[k][j] - (matrix[k][i - 1] if i > 0 else 0)
                    res += c[cur - target]
                    c[cur] += 1
                    print("cur:{}, res:{}, c[{}]:{}".format(cur, res, cur, c[cur]))
        return res

    def numSubmatrixSumTargetPy3(self, matrix: List[List[int]], target: int) -> int:
        if not matrix or not matrix[0]:
            return 0

        presum = list(map(lambda row: list(itertools.accumulate(row)), matrix))

        rows, cols = len(matrix), len(matrix[0])

        count = 0
        for col_start in range(cols):
            for col_end in range(col_start, cols):
                counter = collections.Counter()
                counter[0] = 1
                curr_sum = 0
                for r in range(rows):
                    curr_sum += presum[r][col_end] - (presum[r][col_start - 1] if col_start else 0)
                    count += counter[curr_sum - target]
                    counter[curr_sum] += 1

        return count

    # 多少メモ化したところでTLE
    def numSubmatrixSumTarget2(self, matrix: List[List[int]], target: int) -> int:
        l = len(matrix)
        m = len(matrix[0])
        memo = {}
        ans = 0

        def subsum(i, j) -> int:
            i1, j1 = divmod(i, m)
            i2, j2 = divmod(j, m)
            i1 = min(i1, i2)
            i2 = max(i1, i2)
            j1 = min(j1, j2)
            j2 = max(j1, j2)
            keystr = "{}:{},{}:{}".format(i1, j1, i2, j2)
            print("{}:{} -> {}".format(i, j, keystr))
            if keystr in memo:
                return -1
            subans = 0
            for i in range(i1, i2 + 1):
                lkeystr = "{}:{},{}:{}".format(i, j1, i, j2)
                if lkeystr in memo:
                    subans += memo[lkeystr]
                    continue
                lsubans = 0
                for j in range(j1, j2 + 1):
                    subans += matrix[i][j]
                    lsubans += matrix[i][j]
                memo[lkeystr] = subans
            
            memo[keystr] = subans
            return subans


        for i in range(l * m):
            for j in range(i, l * m):
                if subsum(i, j) == target:
                    ans += 1
            
        return ans


